INSERT INTO `legislacoes` (`cod`, `categoria`, `esfera`, `numero`, `ano`, `data`, `ementa`, `diario`, `anexo`) VALUES
(1, 'Decretos', 'Municipal', '041', 2015, '02/10/2015', 'Este detreto estabelece que os servidores da Secretaria Municipal de Meio Ambiente (SEMMA) lotados na Coordenadoria de Fiscalização e Proteção Ambiental, a competência legal para apurar infrações ambientaos, lavrar instrumentos de fiscalização, aplicar sanções administrativas que evitem a continuidade de danos ambientais.', '', 'https://drive.google.com/file/d/1hURKMDiMkRSFh-fc3tJAW8aBiQk_eGTM/view'),
(2, 'Decretos', 'Municipal', '049', 2021, '03/03/2021', 'Ficam estabelecidos os intervalos para o licenciamento ambiental das atividades descritas nos Anexos I, e II da Resolução COEMA N° 162/2021, de competência de Castanhal, através da Secretaria Municipal de Meio Ambiente – SEMMA.', 'https://drive.google.com/file/d/1ClJTUgAh7EeBlDvoQxOYVAn7HCT72GI1/view', 'https://drive.google.com/file/d/1ZCRoHQUPDu41ykQ0_z7VBxdVkTTC69Hd/view'),
(3, 'Decretos', 'Municipal', '106', 2021, '22/06/2021', 'Este Decreto regulamenta os procedimentos de destinação de produtos e subprodutos apreendidos pelo órgão ambiental competente, no âmbito do Município de Castanhal, em casos de infrações ambientais.', 'https://drive.google.com/file/d/15uuhCu61fFDRso6nULEiHxCGZnj76H5H/view', 'https://drive.google.com/file/d/1TSfCOHdUVIAKOZRjNLIemjWlH5M0Pd65/view'),
(4, 'Decretos', 'Municipal', '230', 2021, '25/11/2021', 'Ficam reenquadrados os intervalos da tipologia Casas de festas e eventos, constantes no anexo II do Decreto Municipal nº 049, de 03 março de 2021, passando a constar da forma descrita na tabela anexa a este Decreto.', 'https://drive.google.com/file/d/1aJiCSy24zIks-Gv4z5GKJ-gz8fj01Zdo/view', 'https://drive.google.com/file/d/1YCxkuKKyEp4Q9hILa3-nHESlaeVS0078/view'),
(5, 'Leis Complementares', 'Municipal', '001', 2020, '11/09/2020', 'Esta Lei Complementar estabelece a reorganização administrativa dos cargos em comissão da Secretaria Municipal de Meio Ambiente.', 'https://drive.google.com/file/d/1JAaWTdS9yU0Ifo88SRGq7--WjoH7KRFU/view', 'https://www.google.com/url?q=https://drive.google.com/uc?id%3D1jO16JTPEwuxxxbuBw0Gf9xMguGFKpwTK&sa=D&source=editors&ust=1670848619408121&usg=AOvVaw17ulvYY7Oz0kCY96OJxoAU'),
(6, 'Leis Complementares', 'Federal', '140', 2011, '08/12/2011', 'Esta Lei Complementar fixa normas, nos termos dos incisos III, VI e VII do caput e do parágrafo único do art. 23 da Constituição Federal, para a cooperação entre a União, os Estados, o Distrito Federal e os Municípios nas ações administrativas decorrentes do exercício da competência comum relativas à proteção das paisagens naturais notáveis, à proteção do meio ambiente, ao combate à poluição em qualquer de suas formas e à preservação das florestas, da fauna e da flora', '', 'http://www.planalto.gov.br/ccivil_03/leis/lcp/lcp140.htm'),
(7, 'Leis', 'Municipal', '015', 2013, '29/04/2013', 'Esta lei, com fundamento nos artigos 23, incisos VI e VII e 225 da Constituição Federal c/c a Lei nº 6.938/1981, estabelece a gestão público integrada no patrimônio ambiental municipal e dos recursos naturais localizados no território sob sua jurisdição, através das normas previstas nesta Lei, na legislação que lhe for complementar e na legislação correlata, federal, estadual e municipal vigentes.', 'https://drive.google.com/file/d/1ZKYY_gWNV1_0NTq-DsYD_2wy2xOZtiUe/view', 'https://drive.google.com/uc?id=1OvoDfXrLPsMDl7Vv4ZYDL6bXeCN478Rb'),
(8, 'Leis', 'Municipal', '016', 2013, '29/04/2013', 'Esta lei estabelece ao Município, competência em buscar a compatibilização do desenvolvimento com a preservação da qualidade de vida da população sendo compatível com o meio ambiente e o equilíbrio ecológico, visando à sustentabilidade, economia, ambiental e social.', 'https://drive.google.com/file/d/1ZKYY_gWNV1_0NTq-DsYD_2wy2xOZtiUe/view', 'https://drive.google.com/uc?id=1z7evdJNRpC4hh0Y7SvTJCt_2423oIIH7'),
(9, 'Leis', 'Municipal', '027', 2018, '20/06/2018', 'O Anexo I, da Lei municipal nº 016/13, de 29 de abril de 2013, que regulamenta a Taxa de Licenciamento Ambiental, passa a vigorar com a seguinte redação da nova Taxa de Licenciamento Ambiental - TLA.', 'https://drive.google.com/file/d/1Des5Y0PRHGC_lhq_-nwBZDqfOO-9WXhf/view', 'https://www.google.com/url?q=https://drive.google.com/uc?id%3D0B2XRym3N7lmjckxMYU14Y3ZvWHdZZDlBZXZjalRyX3o2U0pV&sa=D&source=editors&ust=1670854256389041&usg=AOvVaw3VbmyOk-Xn_2FhLpGOJRLv'),
(10, 'Leis', 'Federal', '9605', 1998, '12/02/1998', 'As condutas e atividades lesivas ao meio ambiente são punidas com a sanções administrativas, civis e penais, na forma estabelecida nesta Lei.', '', 'https://www.planalto.gov.br/ccivil_03/leis/l9605.htm'),
(11, 'Instruções normativas', 'Municipal', '002', 2021, '03/12/2021', 'Os procedimentos e critérios para a tramitação dos pedidos de regularização e licenciamento ambiental, retificação de licenciamento, renovação de licença e mudança de razão social do empreendimento, no âmbito da Secretaria Municipal de Meio Ambiente de Castanhal - SEMMA/Castanhal, passam a ser regulados por esta Instrução Normativa.', 'https://drive.google.com/file/d/1AT1s9A7SXd9IyTXbEPhnD-diwdpc-oEt/view?usp=drive_web', ''),
(12, 'Instruções normativas', 'Municipal', '003', 2021, '20/12/2021', 'Esta Instrução Normativa define os procedimentos e critérios para a instauração de procedimentos de Autorização de Eventos Temporários - AET no âmbito da competência da Secretaria Municipal de Meio Ambiente de Castanhal - SEMMA', 'https://drive.google.com/file/d/1bOKfOdqlAmr2DzkSTj41kFnPZScUxDr_/view', ''),
(13, 'Resoluções', 'CMMA', '001', 2019, '19/12/2019', 'Aprovar o Regimento Interno do Conselho Municipal de Defesa do Meio Ambiente – CMMA, na forma do anexo único, que desta passa a fazer parte integrante', 'https://drive.google.com/file/d/1wb19dZNFFXzFU9HaBPqwuYBDCwOOpRoe/view', ''),
(14, 'Resoluções', 'CMMA', '002', 2020, '27/11/2020', 'Criar 02 (duas) Câmaras Técnicas Permanentes do Conselho Municipal de Defesa do Meio Ambiente, que doravante terá a seguinte composição: I - ASSUNTOS JURÍDICOS; II - ASSUNTOS DE POLUIÇÃO E DEGRADAÇÃO AMBIENTAL.', 'https://drive.google.com/file/d/1D8UlbIugapqcX0zFeS6A63q5NKrOsOzn/view', ''),
(15, 'Resoluções', 'CMMA', '003', 2020, '27/11/2020', 'Nomear a Conselheira MARIA DO AMPARO MEDEIROS GONÇALVES, representante da Associação Comercial e Industrial da Castanhal – ACIC, como Secretária Executiva do CMMA, mediante votação do Plenário, conforme o disposto no artigo 26 do seu Regimento Interno', 'https://drive.google.com/file/d/1D8UlbIugapqcX0zFeS6A63q5NKrOsOzn/view', ''),
(17, 'Resoluções', 'CMMA', '005', 2021, '22/12/2021', 'Aprovar o Regimento Interno do Conselho Municipal de Defesa do Meio Ambiente – CMMA, na forma do anexo único, que desta passa a fazer parte integrante', 'https://drive.google.com/file/d/1yJovHioYUl5DPB6Ydd1kZllkRHCdy7Bm/view?usp=drive_web', ''),
(18, 'Resoluções', 'CMMA', '006', 2022, '10/03/2022', 'Alterar os Itens 1.1.7 do ANEXO II, III e IV da Resolução CMMA n° 004/2021, para acrescentar a Certidão de Uso e Ocupação do Solo, o qual passa a vigorar com a seguinte alteração: 1. Documentos Administrativos: 1.1. Obrigatórios: 1.1.7 Alvará de Localização e Funcionamento ou Certidão de Uso e Ocupação do Solo;', 'https://drive.google.com/file/d/1aaPxXWGxwjn9k4z5DdcxzpgeszNMqL3b/view?usp=drive_web', ''),
(19, 'Resoluções', 'COEMA', '162', 2021, '02/02/2021', 'Regulamenta as atividades de impacto ambiental local, para fins de licenciamento ambiental, de competência dos Municípios no âmbito do Estado do Pará.', 'https://www.ioepa.com.br/pages/2021/2021.02.19.DOE.pdf', 'https://www.semas.pa.gov.br/legislacao/files/pdf/25758.pdf'),
(20, 'Portarias', 'Municipal', '001', 2022, '11/01/2022', 'Fica determinado, a partir de 11 de janeiro de 2022, a realização de expediente interno pela Coordenadoria de Licenciamento Ambiental - CLA às sextas-feiras.', 'https://drive.google.com/file/d/17pz3HoyaTKGjFMLWEZRb65S7ALbvT2_6/view', ''),
(21, 'Portarias', 'Municipal', '1479', 2022, '01/09/2022', 'Considerando, o ofício nº575/2022/GAB/COFISC/SEMMA/PMC, constante do Processo nº2022/8/6083;Art. 1º - Lotar o servidor Luiz Henrique Vilela Araújo, cargo Veterinário, na Coordenadoria de Fiscalização Ambiental da Secretaria Municipal de Meio Ambiente.', 'https://www.google.com/url?q=https://drive.google.com/file/d/1vXq-Rn_YpsxVci6ACzOeGinSqmpMDjz5/view&sa=D&source=editors&ust=1670867927629001&usg=AOvVaw0WjVNgIgLmmBW1R3louMe7', 'https://www.google.com/url?q=https://drive.google.com/file/d/1GJPeKgNhE0s-SNqpFxWVj-wKH6EJxzV3/view?usp%3Dsharing&sa=D&source=editors&ust=1670867927629048&usg=AOvVaw2q92UvqRn92QU4KMfBzWMM'),
(28, 'Resoluções', 'CMMA', '007', 2022, '24/11/2022', 'Ficam estabelecidos os novos enquadramentos dos intervalos das tipologias Comércio varejista de gás liquefeito de petróleo (GLP) e Avicultura para postura e corte (frango, codorna e outros), constante no ANEXO I da Resolução CMMA n° 004/2021, de 20 de outubro de 2021, passando a vigorar com a seguinte alteração', 'https://drive.google.com/file/d/1EolQbpTUUKo2l0IbGLv8wCYO5HQPrNQx/view', ''),
(29, 'Resoluções', 'CMMA', '004', 2021, '20/10/2021', 'Regulamenta a Licença Ambiental Simplificada - LAS, Licença Ambiental Declaratória - LAD e a Dispensa de Licenciamento Ambiental – DLA, concedidas pela Secretaria Municipal de Meio Ambiente aos empreendimentos que realizarem obras e/ou atividades de baixo potencial poluidor/degradador, no âmbito do Município de Castanhal, conforme os critérios a seguir estabelecidos.', 'https://drive.google.com/file/d/14oclEj-o5Pz7uq7Uiy5yvmCZgAdGlEgz/view', 'uploads/legislacao/b601975cb13ed3cb4f8f8074dcbb7ff8.pdf');
